import React from "react";
import { useCallback, useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

const Calender: React.FC<CalenderProps> = (props) => {
  const handleChange = (date: any) => {
    setStartDate(date);
  };
  const toUtcIso8601str = (momentInstance: any) => {
    return momentInstance.clone().utc().format("YYYY-MM-DDTHH:mm:00Z");
  };
  const [startDate, setStartDate] = useState(toUtcIso8601str(new Date()));

  return (
    <React.Fragment>
      <DatePicker selected={startDate} onChange={handleChange} locale="ja" />
    </React.Fragment>
  );
};
export type CalenderProps = {};

export default Calender;
